<script>
    // Simulated data update function
    function updateData(type) {
        if (type === 'incoming') {
            document.getElementById('earningsText').innerHTML = 'Incoming: <span class="fw-medium">$921.40</span>';
        } else if (type === 'earning') {
            document.getElementById('earningsText').innerHTML = 'Earning: <span class="fw-medium">$846.17</span>';
        }
        // Simulated data update for sales
        document.getElementById('salesText').innerHTML = 'Sales: <span class="fw-medium">25.7M</span>';
    }

    // Add event listeners to buttons
    document.addEventListener('DOMContentLoaded', function() {
        document.getElementById('incomingButton').addEventListener('click', function() {
            updateData('incoming');
        });

        document.getElementById('earningButton').addEventListener('click', function() {
            updateData('earning');
        });
    });
</script>
